"""
Any UI globals are here

images specifically stores images normally found on the file system in the source so the built EXE can read them
"""
import sys
import tkinter
from os.path import basename

from PIL import ImageTk, Image

IMAGES = {
    'EmpDat.gif': b'',
    'EmpDat.ico': b''
}


def load_image(path):
    """
    Loads an image accessible to Tkinter. Determines whether to use the image off the file system or bundled with the
    EXE

    :param path: file path if it were to use the filesystem copy
    :return: PhotoImage
    """
    if getattr(sys, 'frozen', False):
        return tkinter.PhotoImage(data=IMAGES[basename(path)])
    else:
        return ImageTk.PhotoImage(Image.open(path))
